import React from "react";
import { FaCalendarAlt } from "react-icons/fa";

const BlogPage = () => {
  // Sample blog posts data (you can replace it with your actual data)
  const blogPosts = [
    {
      id: 1,
      title: "Exciting New Update: Multiplayer Mode Added!",
      date: "April 20, 2024",
      content: "We're thrilled to announce the addition of multiplayer mode...",
    },
    {
      id: 2,
      title: "Upcoming Event: Battle Royale Tournament",
      date: "May 5, 2024",
      content: "Get ready for the ultimate showdown in our upcoming Battle Royale tournament...",
    },
    // Add more blog posts as needed
  ];

  return (
    <div className="container mx-auto py-8 ml-46">
      <h1 className="text-3xl font-bold mb-6 text-center">Game Blog</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {/* First pair of blog posts */}
        <div className="flex">
          {blogPosts.slice(0, 2).map((post) => (
            <div key={post.id} className="bg-gradient-to-br from-blue-400 to-purple-500 rounded-lg shadow-md p-6 flex-1">
              <h2 className="text-xl font-bold mb-2 text-white">{post.title}</h2>
              <div className="flex items-center text-gray-200 mb-2">
                <FaCalendarAlt className="mr-2" />
                <p>{post.date}</p>
              </div>
              <p className="text-gray-200">{post.content}</p>
            </div>
          ))}
        </div>
        {/* Second pair of blog posts */}
        <div className="flex">
          {blogPosts.slice(2).map((post) => (
            <div key={post.id} className="bg-gradient-to-br from-blue-400 to-purple-500 rounded-lg shadow-md p-6 flex-1">
              <h2 className="text-xl font-bold mb-2 text-white">{post.title}</h2>
              <div className="flex items-center text-gray-200 mb-2">
                <FaCalendarAlt className="mr-2" />
                <p>{post.date}</p>
              </div>
              <p className="text-gray-200">{post.content}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default BlogPage;
